import React from 'react'

function DogNameCard({data}) {
  return (
      <>
    {data.map((data, index) => (
        <Card key={index} className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">
          <div className="card-body">
            <h5 className="card-title m-auto">{data}</h5>
          </div>
        </Card>
      ))}
      </>
  )
}

export default DogNameCard
